import {BrowserRouter as Router,Routes ,Route} from "react-router-dom";
import Jion from "./component/Jion/Jion";
import './App.css';


function App() {
  return (
    <div className="App">
     <Router>
      <Routes>
      <Route exact path="/" component={<Jion/>} />

      <Route path="/chat"/>
      </Routes>
     </Router>
     <h1>hell</h1>
    </div>
  );
}

export default App;
